var cacheName="restaurant-reviews-v1";self.addEventListener("install",function(t){t.waitUntil(caches.open(cacheName).then(function(t){return t.addAll(["/","/img/*.jpg","restaurant.html","index.html","js/app.js","js/main.js","js/dbhelper.js","data/restaurants.json","js/restaurant_info.js","css/styles.css","https://cdnjs.cloudflare.com/ajax/libs/normalize/8.0.0/normalize.min.css","https://fonts.googleapis.com/css?family=Roboto:300,400,500,700"]).catch(t=>console.log("caches open : ",t))}))}),self.addEventListener("activate",function(t){t.waitUntil(caches.keys().then(function(t){return Promise.all(t.map(function(t){if(t!==cacheName)return caches.delete(t)}))}))}),self.addEventListener("fetch",function(t){var e=t.request.url;if(e.startsWith("chrome-extension://")||e.startsWith("https://csi.gstatic.com")||e.startsWith("https://maps.googleapis.com"))return fetch(t.request);t.respondWith(caches.open(cacheName).then(function(e){return e.match(t.request).then(function(s){return s||fetch(t.request).then(function(s){return e.put(t.request,s.clone()),s})})}))});